    output = grid.copy()

    def has_internal_holes(region_mask):
        """Check if a region has internal holes (0s completely enclosed by the region)."""
        region_coords = np.argwhere(region_mask)
        if len(region_coords) == 0:
            return False

        min_r, min_c = region_coords.min(axis=0)
        max_r, max_c = region_coords.max(axis=0)
        bbox_h = max_r - min_r + 1
        bbox_w = max_c - min_c + 1

        if bbox_h <= 2 or bbox_w <= 2:
            return False

        local_mask = region_mask[min_r:max_r+1, min_c:max_c+1]
        padded_non_blob = np.pad(~local_mask, 1, mode='constant', constant_values=True)

        visited = np.zeros_like(padded_non_blob, dtype=bool)
        q = deque()

        for i in range(padded_non_blob.shape[0]):
            for j in [0, padded_non_blob.shape[1]-1]:
                if padded_non_blob[i, j] and not visited[i, j]:
                    q.append((i, j))
                    visited[i, j] = True
        for j in range(padded_non_blob.shape[1]):
            for i in [0, padded_non_blob.shape[0]-1]:
                if padded_non_blob[i, j] and not visited[i, j]:
                    q.append((i, j))
                    visited[i, j] = True

        while q:
            r, c = q.popleft()
            for dr, dc in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                nr, nc = r + dr, c + dc
                if 0 <= nr < padded_non_blob.shape[0] and 0 <= nc < padded_non_blob.shape[1]:
                    if padded_non_blob[nr, nc] and not visited[nr, nc]:
                        visited[nr, nc] = True
                        q.append((nr, nc))

        external_reachable = visited[1:-1, 1:-1]
        internal_holes = ~local_mask & ~external_reachable
        return np.any(internal_holes)

    def get_distinct_count(region_mask, axis):
        projection = np.any(region_mask, axis=1-axis)
        return np.sum(projection)

    all_colors = set(np.unique(grid)) - {0, 1, 5}
    if not all_colors:
        return output.tolist()

    templates = {}
