    height_range = max(heights) - min(heights) if len(heights) > 1 else 0
    use_width = width_range >= height_range
    dim_key = 'width' if use_width else 'height'

    solid_templates = [(c, t) for c, t in templates.items() if t['is_solid']]
    holey_templates = [(c, t) for c, t in templates.items() if not t['is_solid']]

    gray_mask = (grid == 5)
